import React from 'react';
import logo from './logo.svg';
import './App.css';
import ScanPage from './pages/ScanPage';
import LoginPage from './pages/LoginPage';

function App() {
  return (
    <div className="App">
      <Route path="/">
        <LoginPage />
      </Route>
      <Route path="/scan">
        <ScanPage />
      </Route>
    </div>
  );
}

export default App;
